import {useSelector} from 'react-redux'

const GetAllExercises = () => {
    const exercises = useSelector(state => state.exercises)

  return (
    <div>
        {exercises.map(exercise => {
            return <p>{exercise.exerciseName}</p>
        })}
    </div>
  )
}

export default GetAllExercises
